scriptlet.script:
// This template shows how to access operation return data, inputs and context data 
// and how to set context data, responses and results. 

// To get value associated with the context key myContextKey: 
query_results = scriptletContext.get("query_results"); 
queryCount = scriptletContext.get("queryCount"); 
fecha_proceso = scriptletContext.get("fecha_proceso");
UIM_MES_FACT = scriptletContext.get("UIM_MES_FACT");
UIM_ANIO_FACT = scriptletContext.get("UIM_ANIO_FACT");

var d = new Date();
var curr_date = d.getDate();
var curr_month = d.getMonth()+1;
var curr_year = d.getFullYear();
var UIM_FECHA_PROCESO = curr_year+"-"+curr_month+"-"+curr_date;

var insert="";
var insert2="";
linea2="";
linea_insert2="";

if(queryCount > 0){
    insert+="BEGIN\n"; 
	linea = query_results.split("\n");
	for(i=0; i < linea.length; i++){
	    linea_insert = linea[i];
	    linea2="";
	    linea2 = linea_insert.split(",");
	    linea_insert2="";
		linea_insert2 = "'"+linea2[0]+"',"; /*UIM_BAN_CODIGO_BANCO*/
		linea_insert2 += "'NA',"; /*UIM_CODIGO_BANCO*/
	    linea_insert2 += linea2[1]+","; /*UIM_TOTAL_TNX*/
	    linea_insert2 += linea2[2]+","; /*UIM_IMPORTE_TOTAL*/
	    linea_insert2 += linea2[3]+","; /*SUBTOTAL_COMISION -> UIM_SUBTOTAL*/
	    linea_insert2 += linea2[4]+","; /*IVA -> UIM_IVA*/
	    linea_insert2 += linea2[5]+","; /*TOTAL_COMISION -> UIM_TOTAL*/
	    linea_insert2 += linea2[6]+",";/*PORCENTAJE_COMISION -> UIM_IMP_NIPS*/
	    linea_insert2 += "0,"; /*MONTO LIQUIDACION MES*/
	    linea_insert2 += "'VTG',"; /*UIM_SERVICIO*/
	    linea_insert2 += "'DETALLE VG TEL',"; /*UIM_DESCRIPCION*/
	    linea_insert2 += UIM_MES_FACT+",";
	    linea_insert2 += UIM_ANIO_FACT;

	    insert+='INSERT INTO TBL_RED_USO_INFRA_MENSUAL (UIM_FECHA_PROCESO,UIM_BAN_CODIGO_BANCO,UIM_CODIGO_BANCO,UIM_TOTAL_TNX,UIM_IMPORTE_TOTAL,UIM_SUBTOTAL,UIM_IVA,UIM_TOTAL,UIM_IMP_NIPS,UIM_IMP_CONS,UIM_SERVICIO,UIM_DESCRIPCION,UIM_MES_FACT,UIM_ANIO_FACT) VALUES (to_date("'+UIM_FECHA_PROCESO+'","yyyy-mm-dd"),'+linea_insert2+');\n';
		insert2+=UIM_FECHA_PROCESO+','+linea_insert2+'\n';
		insert = insert.replace(/\"/g,"'");
		insert = insert.replace(/null/g,"''");

	} // fin for
	insert+="COMMIT;\n";
	insert+="END;";
} // fin if


// Use the context to hold data for use by other steps.  It is also helpful to place information 
// into the context to examine variables when developing and debugging scriptlets. 
// For example to place the OutputString information into a context key called 'Output': 

scriptletContext.putGlobal("INSERT_SENTENCE", insert);
scriptletContext.putGlobal("INSERT_SENTENCE2", insert2);  

// ===========================================================================================
